import React, {Component} from 'react';
import Board from './Components/Board'

class Body extends Component{

	

	render() {
		return(
			<div>
				<Board onSubmit={
        		function(_writer,_title,_desc){
					var writer = _writer;
					var title = _title;
					var desc = _desc;
				}.bind(this)}></Board>
			</div>
		  );
	}
}

export default Body;
